INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "お！\nあそこに困ってそうな人発見！", 1001, 1, 0, 0, 1, "春咲 ひより", 0, 1.4, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 2, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "大切な人を\n守れるようになりたい…って", 1002, 1, 0, 0, 1, "草野 優衣", 0, 1.4, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 2, "みんなみたいに\nわたしも強くならなきゃ", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "キミに必要な集中力と感性が", 1003, 1, 0, 0, 1, "士条 怜", 0, 1.4, 0, "少しは磨かれると思いますよ。", 2, "フェンシングを始めてみては？", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "今日はなにして遊ぶ？", 1004, 1, 0, 0, 1, "穂高 みそぎ", 0, 1.5, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 2, "ねぇ、にいちゃん！", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "ねぇ…", 1006, 1, 0, 0, 1, "風宮 あかり", 0, 1.4, 0, "私といっしょに…\nいかない？", 2, "風宮あかりです", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "プリンたべたいのー", 1007, 1, 0, 0, 1, "出雲 宮子", 0, 1.5, 0, "食べ物の恨みは怖いのー", 2, "出雲宮子なのー", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "キミもボクの美貌に\n吸い寄せられたんだね。", 1008, 1, 0, 0, 1, "虹村 雪", 0, 1.4, 0, "いいよ。\n見られることは運命さ…", 2, "ボクは虹村雪。", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1009, 1, 0, 0, 1, "柊杏奈", 0, 1.4, 0, "人呼んで「疾風の冥姫」!!", 2, "フッ…聞いて後悔するがいい！", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1010, 1, 0, 0, 1, "姫宮 真歩", 0, 1.5, 0, "ほんまおおきにやわ～♪", 2, "マホマホ王国のプリンセス、\nまほ姫どす", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "生き別れたお兄ちゃんを探して\n三千世界！", 1011, 1, 0, 0, 1, "衣之咲 璃乃", 0, 1.4, 0, "ここで会ったが\n100年目～！", 2, "衣之咲璃乃です！", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "ち、超能力って…\n何のことかな～？", 1012, 1, 0, 0, 1, "柏崎 初音", 0, 1.4, 0, "…って、お願い！\n誰にも言わないでおいて～！", 2, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "一応カリスマ読モJKやってまっす！", 1016, 1, 0, 0, 1, "美波 鈴奈", 0, 1.4, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 2, "ちょす！\n美波鈴奈だよ～♪", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "東京は遊園地みたいなところさー", 1017, 1, 0, 0, 1, "喜屋武 香織", 0, 1.4, 0, "でも、沖縄もとってもいいとこさー", 2, "はいたーい。\n喜屋武香織さー。", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "先生って呼ばれるのは\nくすぐったいから", 1018, 1, 0, 0, 1, "支倉 伊緒", 0, 1.4, 0, "イオちゃんって呼んでね。", 2, "支倉伊緒です。", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "あ！/\お兄ちゃ～ん\nまってよ～", 1020, 1, 0, 0, 1, "茜 ミミ", 0, 1.5, 0, "ミミをおいてかないでぇ～", 2, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "あの……\nふぇ……", 1021, 1, 0, 0, 1, "栗林 くるみ", 0, 1.5, 0, "ふぇぇぇぇぇん……", 2, "あ…あの…えっと…\n栗…林…くるみ…です……", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "こんな私に貴重な時間を\n割いていただき、", 1022, 1, 0, 0, 1, "風宮 より", 0, 1.4, 0, "なんてありがとうございます！", 2, "風宮よりです。\nあああああ！", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "おにいちゃんどこいくの？\nえ？", 1023, 1, 0, 0, 1, "北条 綾音", 0, 1.5, 0, "私こっち行きたいー\nね、早く早くー", 2, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "ふ、不束者ですが\nどうぞ末永く…って、", 1025, 1, 0, 0, 1, "天野 すずめ", 0, 1.4, 0, "これて何か違う…\nあああすみません！", 2, "わっ…わっ…私、\n天野すずめといいます！", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "あなたは…運命の……\n伴侶……", 1027, 1, 0, 0, 1, "倉石 恵理子", 0, 1.4, 0, "離しませんわ………\n絶対に…!!", 2, "……クスクス…私は\n…倉石恵理子……", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1028, 1, 0, 0, 1, "佐々木 咲恋", 0, 1.4, 0, "…そうでしょ？？", 2, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "ぇっと…\nキミ、私のこと知らないの?!", 1029, 1, 0, 0, 1, "桜井 望", 0, 1.4, 0, "あはは、\n私もまだまだだなぁ～", 2, "桜井望だよ！\nよろしくねっ", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "初めまして、\n私はニノン・ジュベール申すデス！", 1030, 1, 0, 0, 1, "ニノン・ジュベール", 0, 1.4, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 2, "デケデケデンっ！", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "でもって私の隣にいるのが……\nえ、見えない？", 1031, 1, 0, 0, 1, "上喜 しのぶ", 0, 1.4, 0, "おかしいですね……", 2, "上喜しのぶです。\n手元のドクロが父です。", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "けんども\nそれには足りないモンが…", 1033, 1, 0, 0, 1, "野戸まひる", 0, 1.5, 0, "そう、\nオラのボケに突っ込める相方が…！", 2, "目指すはビッグな\nお笑い芸人だっぺ！", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "ちょっと緊張しちゃって…", 1034, 1, 0, 0, 1, "綾瀬 ゆかり", 0, 1.4, 0, "ちょ\nちょっと一杯飲んできます…！", 2, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "知らない人とは話しちゃいけないので", 1036, 1, 0, 0, 1, "氷川 鏡華", 0, 1.5, 0, "これ以上お話しすることは…\nないです！", 2, "氷川鏡華…です", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "……あ、アラーム。", 1038, 1, 0, 0, 1, "柏崎 栞", 0, 1.4, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 2, "柏崎…栞です。", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "私、一人も友達がいなくて……", 1040, 1, 0, 0, 1, "双葉 碧", 0, 1.4, 0, "野に咲く花が、\n唯一の話相手です。", 2, "ふ、双葉碧です。", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1042, 1, 0, 0, 1, "三角 千歌", 0, 1.4, 0, "そう思っています。", 2, "三角千歌です。", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "あぁ？\nお前のそいつの仲間か？", 1043, 1, 0, 0, 1, "安芸 真琴", 0, 1.4, 0, "う、疑ってすまなかったな…", 2, "安芸真琴だ。", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "生けとし生ける全ての者よ！", 1044, 1, 0, 0, 1, "イリヤ・オーンスタイン", 0, 1.4, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 2, "わらわこそは夜を総べる者！", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "ぐふふふふ……はっ！", 1045, 1, 0, 0, 1, "遠見 空花", 0, 1.4, 0, "ｌク、クウカに何かご用ですか!?", 2, "そこで騎士は妖精を乱暴に……", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1046, 1, 0, 0, 1, "宮坂たまき", 0, 1.4, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 2, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "それでは早速クエストに…", 1048, 1, 0, 0, 1, "大神 美冬", 0, 1.4, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 2, "大神美冬よ！", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "クエストもバトルも\n掃除も洗濯も", 1049, 1, 0, 0, 1, "星野静流", 0, 1.4, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 2, "星野静流だよ！", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "見ての通りの\nセクシー美少女で", 1050, 1, 0, 0, 1, "玉泉美咲", 0, 1.5, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 2, "アタシは玉泉美咲。", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "？？？？", 1052, 1, 0, 0, 1, "リマ", 0, 1.4, 0, "？？？？", 2, "？？？", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "菓子でつろうなどと\n稚拙な策を……", 1053, 1, 0, 0, 1, "モニカ・ヴァイスヴィント", 0, 1.5, 0, "そ、そこまでいうなら\nもらってやる", 2, "モニカ・ヴァイスヴィントだ。", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "菓子でつろうなどと\n稚拙な策を……", 1058, 1, 0, 0, 1, "ペコリーヌ", 0, 1.5, 0, "そ、そこまでいうなら\nもらってやる", 2, "モニカ・ヴァイスヴィントだ。", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "菓子でつろうなどと\n稚拙な策を……", 1059, 1, 0, 0, 1, "コッコロ", 0, 1.5, 0, "そ、そこまでいうなら\nもらってやる", 2, "モニカ・ヴァイスヴィントだ。", 1);
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (0, "菓子でつろうなどと\n稚拙な策を……", 1060, 1, 0, 0, 1, "キャル", 0, 1.5, 0, "そ、そこまでいうなら\nもらってやる", 2, "モニカ・ヴァイスヴィントだ。", 1);
